import * as React from 'react';

type Props = {
  path: string;
  height: string | number;
  width: string | number;
}

export default class Header extends React.Component<Props> {

  render() {
    return (
      <div>
        <iframe title="headerFrame" src={this.props.path} height={this.props.height} width={this.props.width} frameBorder="0" />
      </div>
    );
  }

}
